import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the modal for the listing with data-listing-id 'jun_1'
    await page.waitForSelector("[data-listing-id='jun_1']");
    await page.click("[data-listing-id='jun_1']");
    await page.waitForSelector('.modal-content'); // Wait for the modal to open

    // Take screenshot of the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_opened.png'));

    // Count the amenities
    const amenities = await page.$$eval('.amenity-tag', tags => tags.length);

    // Take screenshot of the amenities
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_amenities_counted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_amenities_counted.png'));

    return {
      success: true,
      action: "Opened the modal for listing 'jun_1' and counted the amenities",
      extractedData: { amenitiesCount: amenities },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

